import './navbar.css';
import { Link } from 'react-router-dom';
import { useMediaQuery } from 'react-responsive';

const Navbar = (props) => {
    const isTabletOrMobile = useMediaQuery({ query: '(max-width: 1224px' })

    return(
        <div>
            {isTabletOrMobile ?(
            <div className='NavBar'>
                <div className='NavBar__Title'>
                    Fitness App
                </div>
                <div className='NavBar__Buttons'>
                    <Link to={'/'} className='NavBar__Button'>Overview</Link>
                    {/* <Link to={'/Add'} className='NavBar__Button'>Add Food/Exercise</Link>
                    <Link to={'/Profile'} className='NavBar__Button'>Profile</Link> */}
                    <Link to={'/Account'} className='NavBar__Button'>Account</Link>
                </div>
            </div>
            ) : (
            <div className='NavBar'>
                <div className='NavBar__Title'>
                    Fitness App
                </div>
                <div className='NavBar__Buttons'>
                    <Link to={'/'} className='NavBar__Button'>Overview</Link>
                    {/* <Link to={'/Add'} className='NavBar__Button'>Add Food/Exercise</Link>
                    <Link to={'/Profile'} className='NavBar__Button'>Profile</Link> */}
                    <Link to={'/Account'} className='NavBar__Button'>Account</Link>
                </div>
            </div>
            )}
        </div>
    )
}

export default Navbar;
